import React, { Component } from 'react'
import "./home.scss";

//Rutas a páginas
import Navbar from '../Navbar/Navbar';
import Footer from '../Footer/Footer';


export default class Home extends Component {
  render() {
    return (
      <div>
         <Navbar conditions={'home'}/>

        <div className="landing">
        <h1>bringit</h1>

        <p>bringit connects shoppers and travelers who help each other access the world.</p>
        {/* <img src="https://images.unsplash.com/photo-1541544181051-e46607bc22a4?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1050&q=80" alt=""/> */}

        </div>
        <Footer />
      </div>
    )
  }
}
